import Link from 'next/link'
// import fetch from 'isomorphic-unfetch'
const index = () => {
  return (
    <div>
      <div>Hello</div>
      <Link href="/about">
        <a>About</a>
      </Link>
    </div>
  )
}

Index.getInitialProps = async () => {}

export default index
